import React from "react";
import "../css/SliderCard.css";

function SliderCard() {
  return (
    <div className="sliderCard">
      <div className="sliderCard-header"></div>
      <div className="sliderCard-body"></div>
      <div className="sliderCard-footer"></div>
    </div>
  );
}

export default SliderCard;
